if (!window.AdyenFE) {
    window.AdyenFE = {};
}

if (!window.AdyenFE.components) {
    window.AdyenFE.components = {};
}

(function () {
    const { elementGenerator: generator, translationService } = AdyenFE;
    /**
     * @typedef TableCell
     * @property {string?} label
     * @property {string?} className
     * @property {(cell: HTMLTableCellElement) => void?} renderer
     */

    /**
     * Renders table cell.
     *
     * @param {'td' | 'th'} type
     * @param {TableCell} cellData
     * @returns {HTMLElement}
     */
    const renderCell = (type, cellData) => {
        const cell = generator.createElement(type, cellData.className, cellData.label);
        cellData.renderer && cellData.renderer(cell);

        return cell;
    };

    const getTableElement = () => {
        return generator.createElementFromHTML(
            '<div class="adl-table-wrapper"><table><thead><tr></tr></thead><tbody></tbody></table></div>'
        );
    };

    /**
     * Data table component.
     *
     * @param {TableCell[]} headers
     * @param {TableCell[][]} items
     * @param {string?} className
     */
    const createDataTable = (headers, items, className) => {
        const tableWrapper = getTableElement();

        headers.forEach((header) => {
            header.label = translationService.translate(header.label);
        });

        const heading = tableWrapper.querySelector('thead tr');
        heading.append(...headers.map((cellData) => renderCell('th', cellData)));

        createTableRows(tableWrapper, items);

        return generator.createElement('div', className, '', null, [tableWrapper]);
    };

    /**
     * Creates a data table.
     *
     * @param {TableCell[]} header
     * @param {TableCell[][]} items
     * @return {HTMLElement}
     */
    const createPaymentsDataTable = (header, items) => {
        /**
         * Renders item card data.
         *
         * @param {TableCell} cellHeader
         * @param {TableCell} cellData
         * @param {string} className
         * @returns {HTMLElement}
         */
        const createCardItemElements = (cellHeader, cellData, className) => {
            const header = generator.createElement('span', 'adlp-info-label', cellHeader.label);
            cellHeader.renderer && cellHeader.renderer(header);
            const cell = generator.createElement('span', 'adlp-info-data', cellData.label);
            cellData.renderer && cellData.renderer(cell);

            return generator.createElement('li', `adlp-payment-info-item ${className}`, '', null, [header, cell]);
        };

        const tableWrapper = getTableElement();
        const mobileWrapper = generator.createElement('div', 'adl-data-table-wrapper');
        mobileWrapper.append(
            ...items.map((item) => {
                const paymentName = generator.createElement('div', 'adlp-payment-method-name', item[0].label);
                const infoList = generator.createElement('ul', 'adlp-payment-info-list', '', null, [
                    createCardItemElements(header[4], item[4], 'adlp-info-status'),
                    createCardItemElements(header[1], item[1], 'adlp-info-currencies'),
                    createCardItemElements(header[2], item[2], 'adlp-info-countries'),
                    createCardItemElements(header[3], item[3], 'adlp-info-type')
                ]);

                const paymentActions = generator.createElement('div', 'adlp-payment-actions');

                item[0].renderer(paymentName);
                item[5].renderer(paymentActions);

                return generator.createElement('div', 'adlp-data-card', '', null, [
                    paymentName,
                    infoList,
                    paymentActions
                ]);
            })
        );

        const heading = tableWrapper.querySelector('thead tr');
        heading.append(...header.map((cellData) => renderCell('th', cellData)));

        createTableRows(tableWrapper, items);

        return generator.createElement('div', '', '', null, [tableWrapper, mobileWrapper]);
    };

    /**
     * Renders table rows.
     *
     * @param tableWrapper
     * @param {TableCell[][]} items
     */
    const createTableRows = (tableWrapper, items) => {
        items.length &&
            tableWrapper.querySelector('tbody').append(
                ...items.map((item) => {
                    const row = generator.createElement('tr');
                    row.append(...item.map((cellData) => renderCell('td', cellData)));

                    return row;
                })
            );
    };

    /**
     * Renders the empty list message with the image.
     *
     * @param {string} label
     * @returns {HTMLElement}
     */
    const createNoItemsMessage = (label) => {
        return generator.createElement('div', 'adlp-no-items-wrapper', '', null, [
            generator.createElementFromHTML(
                '<svg width="213" height="213" viewBox="0 0 213 213" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">' +
                    '<rect width="213" height="213" fill="url(#pattern0)"/>' +
                    '<defs>' +
                    '<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">' +
                    '<use xlink:href="#image0_71_19302" transform="scale(0.00469484)"/>' +
                    '</pattern>' +
                    '<image id="image0_71_19302" width="213" height="213" xlink:href="data:image/png;base64,' +
                    '' +
                    '' +
                    '"/>' +
                    '</defs>' +
                    '</svg>'
            ),
            generator.createElement('p', '', label)
        ]);
    };

    AdyenFE.components.DataTable = {
        createDataTable,
        createPaymentsDataTable,
        createTableRows,
        createNoItemsMessage
    };
})();
